import Cita from "./Cita.js";
import { Link } from "react-router-dom";



recibirMesas();
function recibirMesas() {
  fetch("/api/mesas")
    .then(function (res) {
      return res.json();
    })
    .then(function (datos) {
      let mesas = "";
      for (let i = 0; i < datos.length; i++) {
        mesas += `
            <div>
                <p>Color: ${datos[i].color}</p>
                <p>Tamaño: ${datos[i].tamanyo}</p>
                <p>Patas: ${datos[i].patas}</p>
                <p>Material: ${datos[i].material}</p>
            </div>

        `;
      }
      document.getElementById("div1").innerHTML = mesas;
    });
}


function Salud(props) {
    return (
        <div class="w3-main">

            <div class="w3-container">
                <h5>Salud</h5>
                <table class="w3-table w3-striped w3-bordered w3-border w3-hoverable w3-white">
                    <thead>
                        <th>Descripción</th>
                        <th>Fecha</th>
                        <th>Precio</th>
                    </thead>
                    <tr>
                        <td>1ª Desparasitación</td>
                        <td>01/07/2020</td>
                        <td>5€</td>
                    </tr>
                    <tr>
                        <td>Test de la leucemia</td>
                        <td>18/11/2020</td>
                        <td>5€</td>
                    </tr>
                    <tr>
                        <td>1ª Trivalente felina</td>
                        <td>25/11/2020</td>
                        <td>5€</td>
                    </tr>
                    <tr>
                        <td>2ª Desparasitación</td>
                        <td>14/12/2020</td>
                        <td>5€</td>
                    </tr>
                    <tr>
                        <td>2ª Trivalente felina</td>
                        <td>25/12/2020</td>
                        <td>5€</td>
                    </tr>
                </table><br />
                <Link to="./Cita"><button class="w3-button w3-dark-grey"  >Añadir cita <i class="fa fa-arrow-right"></i></button></Link>
        </div>
        </div >

    );
}

export default Salud
